const useStyles = (theme) => ({
  root: {
    '& > *': {
      margin: theme.spacing(1),
      width: '25ch',
    },
  },
});

class Answer extends Component{

  constructor(props)
  {
    super(props);
    this.state=
    {
      answer:"",
    }
    this.handleSubmit=this.handleSubmit.bind(this);
  }
  handleSubmit(event){
    console.log("Yes"+event.target.value);
  }

  render()
  {
  const {classes} = this.props;




  return (
    <form className="ans-div" noValidate autoComplete="off" onSubmit={handleSubmit}>

      <TextField id="filled-basic" label="Type your answer here." variant="filled" />

    </form>
  );
  }
}
export default withStyles(useStyles)(Answer)
